import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  mainContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "flex-start",
    justifyContent: "center",
    height: "100%",
  },
  innerContainer: {
    marginTop: theme.spacing(10),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    flexWrap: "wrap",
    justifyContent: "center",
    width: "500px",
    height: "30vh",
    padding: "20px",
    margin: "50px 0",
    borderRadius: "10px"
  },
  imgContainer:{
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    flexWrap: "wrap",
    width: "100%",
  },
  doraImg:{
      height: "250px",
  },
  iplLogo:{
    height: "50px",
    marginBottom: "10px",
},
}));
